<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="Iris">Iris<a class="anchor-link" href="#Iris">&#182;</a></h1><p>This notebook is an example on how to use the Vertica ML Python Library. We will use the Iris dataset to predict flowers species. You can download the Jupyter Notebook of the study by clicking <a href="iris.ipynb">here</a>. To achieve our goals, we have access to the following data.</p>
<p><ul class="ul_content">
    <li><b>PetalLengthCm: </b>Petal Length in Cm</li>
    <li><b>PetalWidthCm: </b>Petal Width in Cm</li>
    <li><b>SepalLengthCm: </b>Sepal Length in Cm</li>
    <li><b>SepalWidthCm: </b>Sepal Width in Cm</li>
    <li><b>Species: </b>The Flower Specie (Setosa, Virginica, Versicolor)</li>
</ul></p>
<p>We will follow the entire Data Science cycle (Data Exploration - Data Preparation - Data Modeling - Model Evaluation - Model Deployment) and solve this easy use-case. The purpose is to show you some of the library interesting functionalities.</p>
<h2 id="Initialization">Initialization<a class="anchor-link" href="#Initialization">&#182;</a></h2><p>Let's create a Virtual DataFrame of the dataset.</p>

</div>
</div>
</div>
