<p>We need a clear Business Understanding to create the correct features.</p>
<p>By looking at the descriptive statistics, we can notice that we don't have too much information about the features. The only interesting features we could create are ratios. Indeed, different flower types will have different proportions.</p>
<p>Besides, we need to use the One Hot Encoder on the 'Species' to get information about each individual specie.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[3]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">iris</span><span class="p">[</span><span class="s2">&quot;Species&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">get_dummies</span><span class="p">(</span><span class="n">drop_first</span> <span class="o">=</span> <span class="kc">False</span><span class="p">)</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span>
    <span class="s2">&quot;ratio_pwl&quot;</span><span class="p">,</span> <span class="s2">&quot;PetalWidthCm / PetalLengthCm&quot;</span><span class="p">)</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span>
    <span class="s2">&quot;ratio_swl&quot;</span><span class="p">,</span> <span class="s2">&quot;SepalWidthCm / SepalLengthCm&quot;</span><span class="p">)</span>
</pre></div>

